import React, { useState} from 'react';
import Header from '../../components/header/header';
import api from '../../services/api';
import { FiSearch } from 'react-icons/fi';


import './style.css';
import '../../globalStyle/style.css';

export default class Product extends React.Component {
        state = {
          products: []
        }
      
        componentDidMount() {
          api.get(`/`)
            .then(res => {
              const products = res.data;
              this.setState({ products });
            })
        }
render(){
    return(
        <div className="content">
            <div className="container">
                <Header />
                <div className="products">
                    <div className="wrapper">
                        <p>Produtos</p>
                        <input type="text" placeholder="Codigo, descrição"></input>
                        {/* <button type="button" onClick={() => SearchProduct()}> */}
                            <FiSearch size={20} color="#ffffff" />
                        {/* </button> */}
                    </div>
                    
                    <div class="product">
                    { this.state.products.map(product => <li>{product.produto}</li>)}
                        <p>ID: </p>
                        <p>Descrição: </p>
                        <p>valor venda: 10.00</p>
                        <p>Estoque: 5</p>
                        <p>Fator: 1</p>
                        <p>QTD promo: 10</p>
                        <p>Valor promo:4</p>
                    </div>
                   
                </div>
                
            </div>
        </div>
    )
}
}
